import './App.css';
import Row from './components/Row';
import requests from './requests';

function App() {
  return (
    <div>
    <h1></h1>
    <Row title="NetFlix Originals" fetchUrl={requests.fetchNetflixOriginals}></Row>
    <Row title="Trending In India" fetchUrl={requests.fetchTrending}></Row>
    <Row title="Top Rated Movies" fetchUrl={requests.fetchNetflixOrinals}></Row>
    <Row title="Action Movies" fetchUrl={requests.fetchNetflixOriginals}></Row>
    <Row title="Comedy Movies" fetchUrl={requests.fetchNetflixOriginals}></Row>
    <Row title="Horror Movies" fetchUrl={requests.fetchNetflixOriginals}></Row>
    <Row title="Romance Movies" fetchUrl={requests.fetchNetflixOriginals}></Row>
    <Row title="Documentaries" fetchUrl={requests.fetchNetflixOriginals}></Row>
    </div>
  );
}

export default App;
